import './Admin.css';
import NavAdmin from './Nav/Main';
import QuoteAdmin from './Quote/Main';
import AddAdmin from './Add/Main';
import Media from 'react-media';
import LAstAdd from './LastAdd/Main';

// Export Compoent Admin
export default function REturnAdmin() {
 return (
  <div className='wrp-admin'>
   <NavAdmin />
   <Media queries={{
    small: "(max-width: 599px)",
    medium: "(min-width: 600px) and (max-width: 1199px)",
    large: "(min-width: 1200px)"
   }}>

    {matches => (
     <>
      {matches.small && <ScreenSmall />}
      {matches.medium && <ScreenLarge />}
      {matches.large && <ScreenLarge />}
     </>
    )}
   </Media>
  </div>
 );
};

export const ScreenLarge = () => (
 <>
  <div className='flx-admin-add'>
   <QuoteAdmin />
   <AddAdmin />
  </div>

  <LAstAdd />
 </>
);
export const ScreenSmall = () => (
 <div className='flx-admin-add-sm'>
  <QuoteAdmin />
  <AddAdmin />
 </div>
);
